'''
    https://leetcode.com/problems/number-of-matching-subsequences/

    792. Number of Matching Subsequences

    Given a string s and an array of strings words, return the number of words[i] that is a subsequence of s.

    A subsequence of a string is a new string generated from the original string with some characters (can be none)
    deleted without changing the relative order of the remaining characters.

    For example, "ace" is a subsequence of "abcde".
'''

'''
    Accepted but time limit exceeded
'''


class Solution:
    def numMatchingSubseqHelper(self, s, word):
        # check if the first letter in word is in s
        if len(word) <= 0:
            # it means we matched up all the letters in word with letters from s
            return True
        else:
            wFirstLetter = word[0]
            wIndexInS = s.find(wFirstLetter)

            if wIndexInS >= 0:
                # we found the first letter of `word` in s so we need to continue to the other letters in `word`
                return self.numMatchingSubseqHelper(s[wIndexInS + 1:], word[1:])
            else:
                # we couldn't find the first letter of `word` in s so we return False
                # => no way to generate subsequence
                return False

    def numMatchingSubseq(self, s: str, words: [str]) -> int:
        # will keep track of how many words in `words` exist as a subsequence in `s`
        count = 0

        for word in words:
            if self.numMatchingSubseqHelper(s, word):
                count += 1

        return count


class Solution2:
    def numMatchingSubseqHelper(self, s, word):
        # check if the first letter in word is in s
        if len(word) <= 0:
            # it means we matched up all the letters in word with letters from s
            return True
        else:
            wFirstLetter = word[0]
            wIndexInS = s.find(wFirstLetter)

            if wIndexInS >= 0:
                # we found the first letter of `word` in s so we need to continue to the other letters in `word`
                return self.numMatchingSubseqHelper(s[wIndexInS + 1:], word[1:])
            else:
                # we couldn't find the first letter of `word` in s so we return False
                # => no way to generate subsequence
                return False

    def numMatchingSubseq(self, s: str, words: [str]) -> int:
        # will keep track of how many words in `words` exist as a subsequence in `s`
        count = 0

        for word in words:
            # let's remove from s all the letters that are not in word
            wordLetters = set(list(word))

            alphabet = list('abcdefghijklmnopqrstuvwxyz')

            sCopy = s

            for letter in alphabet:
                if letter not in wordLetters:
                    sCopy = sCopy.replace(letter, '')

            if self.numMatchingSubseqHelper(sCopy, word):
                count += 1

        return count


'''
    Let's try the same as Solution2 but with iteration instead of recursion
    Also, let's not remove any letters from s because that is a lot of extra cost per iteration
    
    Accepted
'''


class Solution3:
    def numMatchingSubseqHelper(self, s, word):
        while True:
            if len(s) == 0:
                # if word is also out of letters, then it means we matched up letters in word with letters in s => return True
                # if word is not out of letters, it means we still have letters in word that we need to match up but s is empty => return False
                return len(word) == 0

            if len(word) == 0:
                # we matched up all the letters in word with letters in s
                return True

            wFirstLetter = word[0]
            wIndexInS = s.find(wFirstLetter)

            if wIndexInS >= 0:
                # we found the first letter of `word` in s so we need to continue to the other letters in `word`
                s = s[wIndexInS + 1:]
                word = word[1:]
            else:
                # we couldn't find the first letter of `word` in s so we return False
                # => no way to generate subsequence
                return False

    def numMatchingSubseq(self, s: str, words: [str]) -> int:
        # will keep track of how many words in `words` exist as a subsequence in `s`
        count = 0

        for word in words:
            if self.numMatchingSubseqHelper(s, word):
                count += 1

        return count


